import React from 'react';
import {Card} from 'antd';
import 'antd/dist/antd.css';
import StNum from '../statistics/number';

class Card1 extends React.Component {
    render() {


        return (
            <div>
                <Card size="small" style={{ width: 250 }}>
                    <StNum />
                    <p>Card content</p>
                </Card>
            </div>
        );
    }
}

export default Card1;
